import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { FaSearch, FaExternalLinkAlt } from 'react-icons/fa';

const Projects = () => {
  const [ref, inView] = useInView({
    threshold: 0.1,
    triggerOnce: true,
  });

  const [activeFilter, setActiveFilter] = useState('all');

  const projects = [
    {
      id: 1,
      title: "Modern Ofis Kompleksi",
      category: "ticari",
      location: "Ä°ÅŸ Merkezi",
      year: "2024",
      description: "SÃ¼rdÃ¼rÃ¼lebilir tasarÄ±m ve modern olanaklar iÃ§eren devlet-of-the-art ofis kompleksi.",
      image: "ðŸ¢",
      stats: { area: "25,000 mÂ²", duration: "18 ay", budget: "15M TL" }
    },
    {
      id: 2,
      title: "LÃ¼ks Konut Kulesi",
      category: "konut",
      location: "Sahil BÃ¶lgesi",
      year: "2023",
      description: "Panoramik manzaralÄ± ve lÃ¼ks olanaklara sahip premium konut geliÅŸtirme projesi.",
      image: "ðŸ ",
      stats: { area: "150 daire", duration: "24 ay", budget: "45M TL" }
    },
    {
      id: 3,
      title: "EndÃ¼striyel Ãœretim Tesisi",
      category: "endustriyel",
      location: "EndÃ¼stri BÃ¶lgesi",
      year: "2023",
      description: "Verimlilik ve sÃ¼rdÃ¼rÃ¼lebilirlik iÃ§in tasarlanmÄ±ÅŸ geliÅŸmiÅŸ Ã¼retim tesisi.",
      image: "ðŸ­",
      stats: { area: "50,000 mÂ²", duration: "12 ay", budget: "30M TL" }
    },
    {
      id: 4,
      title: "AlÄ±ÅŸveriÅŸ Merkezi Yenileme",
      category: "ticari",
      location: "AlÄ±ÅŸveriÅŸ Merkezi",
      year: "2023",
      description: "Mevcut perakende alanÄ±nÄ±n tamamen yenilenmesi ve modernizasyonu.",
      image: "ðŸ›ï¸",
      stats: { area: "100,000 mÂ²", duration: "8 ay", budget: "20M TL" }
    },
    {
      id: 5,
      title: "Eko-Dostu Topluluk",
      category: "konut",
      location: "YeÅŸil Vadi",
      year: "2022",
      description: "YeÅŸil bina uygulamalarÄ± ile sÃ¼rdÃ¼rÃ¼lebilir konut topluluÄŸu.",
      image: "ðŸŒ±",
      stats: { area: "200 ev", duration: "36 ay", budget: "60M TL" }
    },
    {
      id: 6,
      title: "AkÄ±llÄ± Depo Tesisi",
      category: "endustriyel",
      location: "Lojistik Merkezi",
      year: "2022",
      description: "Robotik ve keskin teknoloji ile otomatik depo.",
      image: "ðŸ“¦",
      stats: { area: "75,000 mÂ²", duration: "15 ay", budget: "35M TL" }
    }
  ];

  const filters = [
    { key: 'all', label: 'TÃ¼m Projeler' },
    { key: 'ticari', label: 'Ticari' },
    { key: 'konut', label: 'Konut' },
    { key: 'endustriyel', label: 'EndÃ¼striyel' }
  ];

  const filteredProjects = projects.filter(project => 
    activeFilter === 'all' || project.category === activeFilter
  );

  return (
    <section id="projects" className="section-padding bg-gray-50">
      <div className="container-custom">
        <motion.div
          ref={ref}
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-gray-900 mb-6">
            Projelerimiz
          </h2>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            UzmanlÄ±ÄŸÄ±mÄ±zÄ± gÃ¶steren baÅŸarÄ±lÄ± projelerimizi keÅŸfedin.
          </p>
        </motion.div>

        {/* Filter Buttons */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.6, delay: 0.2 }}
          className="flex flex-wrap justify-center gap-4 mb-12"
        >
          {filters.map((filter) => (
            <motion.button
              key={filter.key}
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              onClick={() => setActiveFilter(filter.key)}
              className={`px-6 py-3 rounded-lg font-medium transition-all duration-300 ${
                activeFilter === filter.key
                  ? 'bg-blue-600 text-white shadow-lg'
                  : 'bg-white text-gray-700 hover:bg-blue-50 border border-gray-200'
              }`}
            >
              {filter.label}
            </motion.button>
          ))}
        </motion.div>

        {/* Projects Grid */}
        <AnimatePresence mode="wait">
          <motion.div
            key={activeFilter}
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -30 }}
            transition={{ duration: 0.5 }}
            className="grid md:grid-cols-2 lg:grid-cols-3 gap-8"
          >
            {filteredProjects.map((project, index) => (
              <motion.div
                key={project.id}
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                whileHover={{ y: -5 }}
                className="bg-white rounded-2xl shadow-lg hover:shadow-xl transition-all duration-300 overflow-hidden group"
              >
                {/* Project Image */}
                <div className="relative h-64 bg-gradient-to-br from-blue-600 to-blue-800 flex items-center justify-center">
                  <div className="text-6xl">{project.image}</div>
                  <div className="absolute inset-0 bg-black/20 group-hover:bg-black/30 transition-all duration-300"></div>

                  {/* Overlay */}
                  <div className="absolute inset-0 flex items-center justify-center opacity-0 group-hover:opacity-100 transition-all duration-300">
                    <motion.button
                      whileHover={{ scale: 1.1 }}
                      whileTap={{ scale: 0.9 }}
                      className="bg-white/90 text-blue-600 p-3 rounded-full"
                    >
                      <FaSearch className="text-xl" />
                    </motion.button>
                  </div>

                  {/* Category Badge */}
                  <div className="absolute top-4 left-4">
                    <span className="bg-white/90 text-blue-600 px-3 py-1 rounded-full text-sm font-medium">
                      {project.category.charAt(0).toUpperCase() + project.category.slice(1)}
                    </span>
                  </div>
                </div>

                {/* Project Info */}
                <div className="p-6">
                  <div className="flex items-center justify-between mb-3">
                    <h3 className="text-xl font-bold text-gray-900">
                      {project.title}
                    </h3>
                    <motion.button
                      whileHover={{ scale: 1.1 }}
                      whileTap={{ scale: 0.9 }}
                      className="text-blue-600 hover:text-blue-700 transition-colors duration-300"
